export const Data = [
    {
      question: 'Who are We ?',
      answer:
        'FarmToDoor is an online platform where farmers can sell their harvest to buyers in their area. Our mission is to help small farmers increase their profits while providing fresh, locally grown produce to our customers.'
    },
    {
      question: 'How does FarmToDoor work?',
      answer:
        'Farmers can sign up on our website to list their available produce. Buyers can then browse the available products and place orders. The farmers will receive the orders and we will coordinate delivery the delivery from farmers to buyers.'
    },
    {
      question: 'What kind of products are available on FarmToDoor?',
      answer:
        ' We offer a variety of fresh, locally grown produce including fruits, vegetables, cereals, and more. Our products are sourced directly from local farmers to ensure the highest quality and freshness.'
    },
    {
      question: 'How do I place an order on FarmToDoor?',
      answer:
        ' To place an order, simply browse the available products on our website and add them to your cart. Once you are ready to checkout, you will be prompted to enter your delivery address and payment information. The farmers will receive your order and then we will coordinate your delivery or pickup with you directly.'
    },
    {
      question: 'How are the prices on FarmToDoor determined?',
      answer:
        'The prices for products on FarmToDoor are set by the farmers themselves. We add additional fees of 5% of their total sales which is half than what is charged by middlemen(10-20%). This allows farmers to set fair prices for their products and receive the maximum profits from their sales.'
    },
    {
      question: 'Is FarmToDoor available in my area?',
      answer:
        'We are currently available in selective areas, but are constantly expanding our network of farmers and buyers. To see if FarmToDoor is available in your area, please check our website or contact us directly.'
    },
    {
      question: 'How do I sign up to sell my produce on FarmToDoor?',
      answer:
        'If you are a farmer interested in selling your produce on FarmToDoor, please sign up on our website and create a seller profile. Once your profile is approved, you can start listing your available products and connecting with local buyers.'
    },
    {
      question: 'How do I contact FarmToDoor customer support?',
